INSERT INTO `deliverable_metadata_elements` VALUES ('994', '431', '8', 'This working paper presents the results of the mapping of actors and of agroclimatic information needs in pilot sites in Colombia for two annual crops, fundamental for food security: maize and bush beans. The mapping of the actors that transmit information to farmers, the confidence the latter have in the information provided, and their information needs for decision-making, allows us to understand the broad spectrum of issues and priorities to be taken into account in the production of these crops, and suggest solutions that are useful, relevant, reliable, sustainable and applicable. Under this assumption, we conducted 27 semi-structured interviews with key informants and 12 focus groups with a total of 151 farmers in the departments of Córdoba and Santander.\r\nResults show that one of the priorities of farmers is to receive reliable local agroclimatic information that enables them to take decisions on planting, varieties, inputs, soil and crop management, that address climate variability. We find a generalized distrust of official institutions that transmit weather information, and a feeling that institutions are not interested in smallholders. Farmers resort to indebtedness to produce beans and maize, or subsidize production with cash crops, while access to agricultural insurance is limited.\r\n\r\nThe format preferred to receive weather information is text messages (phone) and information through the local radio. The creation of groups of farmers and experts who interact in person or virtually seem a useful and reliable alternative to receive and share information in real time. However, farmers are only interested in adopting farm management changes after a forecast if: a) the information is local, b) the information is given by a trusted source such as experts or other farmers, c) the information is transmitted at the right time for decision-making d) the effects of taking these decisions are measurable, verifiable and validated, for example, through pilots or results from experimental plots in two consecutive years.\r\n\r\nDeliverables List:\r\n• Working paper: Mapping networks \r\n• Infonote: https://cgspace.cgiar.org/handle/10568/71109\r\n• StoryMap: http://csi.maps.arcgis.com/apps/MapJournal/index.html?appid=cf80a6f0bb014b56b8cfee3ef9fef49a\r\n• 5 BlogPost: \r\nhttp://dapa.ciat.cgiar.org/farming-is-an-adventure-a-glance-at-climate-variability-in-santander-colombia/\r\nhttp://dapa.ciat.cgiar.org/redes-de-informacion-de-maiz-y-frijol-en-colombia/\r\nhttp://dapa.ciat.cgiar.org/informacion-climatica-local-un-reto-para-la-produccion-de-maiz-en-cordoba/\r\nhttp://dapa.ciat.cgiar.org/comprendiendo-las-dinamicas-y-necesidades-de-los-productores-de-frijol-en-santander/\r\nhttp://dapa.ciat.cgiar.org/los-agricultores-quieren-informacion-util-relevante-confiable-y-aplicable/\r\n\r\n•  Press release: http://www.vanguardia.com/economia/local/332600-sequia-en-santander-genero-la-perdida-del-80-de-la-cosecha-de-frijol\r\n•  CSPNewsletter: http://www.climate-services.org/wp-content/uploads/2015/08/CSPNewsletter_July-2015.pdf');
