INSERT INTO `deliverable_metadata_elements` VALUES ('1504', '450', '8', 'Historical station data from 102 stations across the 11 ICPAC member states and satellite Rainfall Estimates (RFEs) data from the Climate Hazards Group (CHG) covering the period 1981-2014 were assembled. The station data have been blended with the satellite RFEs to produce a better representative dataset at monthly and 10 day time scales at 5 km resolution covering the Greater Horn of Africa.\r\nThe 2015 activity focused on achieving a seasonal climate forecast with improved skill and spatial resolution for the EA region by ICPAC. The -activities that have been conducted in 2015 include identification of the best weather forecast downscaling tools for the Eastern Africa region, assembling the required historical data, and production of gridded climatological dataset with high spatial and temporal resolution, developing tools for data preparation, scripting and operationalization of statistical downscaling using CPT tool, improvement of ICPAC weather forecasts through verification of previous seasonal outlooks, identification of gaps for further improvement & production of high resolution 10-day forecasts, downscaling of seasonal 2015 forecasts to monthly scales, identification of early warning triggers and indicators, and initial forecast downscaling for agricultural applications, and  dissemination of downscaled forecasts and ago-advisories (GHACOF41). The major achievements were incorporation of quantified rainfall amounts in the ICPACs seasonal climate forecasts, evaluation of the skill of past seasonal climate forecast and developing scripts and tools that improve climate forecast skills.');
