INSERT INTO `deliverable_metadata_elements` VALUES ('2626', '987', '8', 'Halewood M, (ed.). (2015) Mutually supportive implementation of the Plant Treaty and the Nagoya Protocol: A primer for National Focal Points and other stakeholders. Discussion Paper. Rome, Italy: Bioversity International. \r\n\r\nThis discussion draft is based upon a structured set of interactions – a survey, a workshop, held 3-6 June 2014 and follow-up analysis – involving ‘tandems’ (the national focal points for the Nagoya Protocol (NP) of the Convention on Biological Diversity (CBD) and the International Treaty on Plant Genetic Resources for Food and Agriculture (ITPGRFA) from a single country working together as a team) and independent experts and stakeholders whose daily activities are affected by access and benefit-sharing (ABS) regulations.  We hope this document will provide national policy actors with a tool to increase their ability and confidence to implement the CBD/NP and ITPGRFA/multilateral system of access and benefit-sharing in mutually supportive ways.\r\n\r\nFrench version: Halewood, M. (ed.) (2015). Mise en œuvre concertee et solidaire du Traite sur les ressources phytogenetiques et du Protocole de Nagoya : Abecedaire pour points focaux nationaux et autres parties prenantes. Ebauche de discussion. Bioversity International 88 p. Available at: https://cgspace.cgiar.org/handle/10568/71062');
