INSERT INTO `deliverable_metadata_elements` VALUES ('5992', '959', '8', 'Title: The importance of international PGRFA exchanges for national crop improvement: how past patterns and future needs support the implementation of the International Treaty on Plant Genetic Resources for Food and Agriculture in Burkina Faso\r\n\r\nAbstract: This working paper analyses and discusses patterns of past, present and future interdependence on plant genetic resources for food agriculture in Burkina Faso, in the context of the implementation of the International Treaty on Plant Genetic Resources for Food and Agriculture. \r\n\r\nThe retrospective element traces back the history of domestication or introduction of key crops in Burkina Faso and their subsequent adoption/diffusion; the present-day dimension provides a snapshot of important achievements based on international PGRFA exchanges; the future perspective include an investigation of future potential germplasm needs to respond to the likely impacts of climate change on Burkinabe agricultural production. The paper should contribute to increased awareness among stakeholders about the extent to which Burkina Faso is dependent upon germplasm from other countries for its food security, and how, in a complementary manner, other countries rely upon germplasm from Burkina Faso. It is hoped that this will support and encourage national implementation of the International Treaty and its Multilateral System of Access and Benefit Sharing.');
