INSERT INTO `deliverable_metadata_elements` VALUES ('6026', '942', '8', 'The brief \"climate change adaptation and mutually supportive implementation of access and benefit Sharing policies in Uganda\' describes a strategy being developed and implemented for climate change adaptation through facilitated access to genetic resources  by making use of the multilateral system of Access and Benefit Sharing (ABS) and the CBD Nagoya protocol. The strategy is currently informing the revision of the 2007 ABS law and regulations that aims to bring the implementation of the ITPGRFA in harmony with the provisions of the CBD and the Nagoya Protocol.');
