INSERT INTO `deliverable_metadata_elements` VALUES ('6060', '937', '8', '1) Costa Rica official notification to the Secretary of the International Treaty on Plant Genetic Resources for Food and Agriculture about the national collections of plant genetic resources that are included in the multilateral system of the Treaty and therefore fully available for plant researchers and breeders around the world.\r\n2) Memorandum of understanding between the national focal point for the CBD (CONAGEBIO) and the national focal point for the ITPGRFA (CONAREFI and Ministry of Agriculture) creating space for the implementation of MLS in Costa Rica and defining the responsibilities of both organizations in relation to the MLS. \r\n3) Proposals for modifications to the National Seed Law to recognize the authority of the National Seed Office (OFINASE) and the CONAREFI as the organizations in charge of coordinating the implementation of the multilateral system in Costa Rica.');
