INSERT INTO `deliverable_metadata_elements` VALUES ('6162', '986', '8', 'Title: Non-monetary benefit sharing mechanisms within the projects funded by the Benefit Sharing Fund\r\nSummary: This study presents an overview of the projects that have been funded by or proposed to the Benefit-sharing Fund (BSF) under the International Treaty on Plant Genetic Resources for Food and Agriculture (ITPRFA). In particular, the study focuses on the technology transfer, capacity building and information exchange-related activities that are included in those projects. Through the analysis, we address the following issues: \r\n- The geographic scope of projects, and the activities and partnerships within them\r\n- The types of technologies, capacities and information being generated and transferred\r\n- The actors involved in the co-development and transfer of technologies, capacities and information)\r\n- Situations in which technology transfer, capacity building and information exchange are pursued or promoted together as part of a package and when they are pursued or promoted independently of each other. \r\n\r\nThe analysis confirms that the BSF can be a useful instrument to facilitate non-monetary as well as monetary benefit sharing. In addition the analysis suggests that there are opportunities to increase the proportion of support for projects where the spill-over non-monetary benefits would be useful for down-stream beneficiaries from subregional to global scales. This focus on spillover benefits would apply not only to PGRFA included in the MLS (which is always available to all parties) but also technologies, knowledge and capacities developed with support from the BSF. At the same time, to keep benefits on the ground and connected to national priorities, countries could be required to continue to demonstrate how support from the BSF will contribute to a nationally developed strategy, with complementary contributions from the country itself.\r\nThe study was submitted to the Ad Hoc Open-Ended Working Group to Enhance the Functioning of the Multilateral System of Access and Benefit-Sharing and presented and discussed at a Multistakeholder Workshop organized by the Swiss Delegation with the title \"International Treaty on Plant Genetic Resources for Food and Agriculture: What Investment Strategy for the Benefit Sharing Fund?\"');
