INSERT INTO `deliverable_metadata_elements` VALUES ('6332', '306', '8', 'This directory includes information on potential sources of funding for projects that seek to\r\n\r\nreduce greenhouse gas (GHG) emissions in agriculture in low-income countries. To meet\r\n\r\nfood security needs as well as commitments to reducing GHG emissions, a number of\r\n\r\ncountries have been interested in how to access climate finance. For decades it has been\r\n\r\nwell known that improved rural finance can support farm innovation by providing the capital\r\n\r\nresources for initial investments. Investments have been made in improved irrigation,\r\n\r\nseedlings, machinery, or other inputs that are constraints for many poor farmers, as well as\r\n\r\nin efforts to facilitate farmer innovation through extension, demonstration sites, and support\r\n\r\nfor farmer organizations and farmers’ experiments. With international pledges to provide\r\n\r\nfinance for climate change and the need to reduce emissions in ways that also achieve\r\n\r\nsustainable development, new kinds of finance for agriculture are becoming rapidly\r\n\r\navailable. Yet many people in the agriculture sector remain unaware of these sources or the\r\n\r\nmeans for accessing them.\r\n\r\nThis directory was prepared at the request of the CGIAR Research Program on Climate\r\n\r\nChange, Agriculture and Food Security (CCAFS) to contribute to research outcomes in low\r\n\r\nemissions agriculture. CCAFS and its partners have been supporting research for the\r\n\r\ndevelopment of low emissions paddy rice, livestock, pasture management, agroforestry and\r\n\r\nfertilizer use in production systems of smallholder farmers in low-income countries. As part\r\n\r\nof this research CCAFS aims to support the scaling up of appropriate practices through\r\n\r\npolicy and climate finance mechanisms, such as Nationally Appropriate Mitigation Actions\r\n\r\n(NAMAs). This product is intended to support national governments in reaching donors and\r\n\r\naccessing such finance to reach their full potential impacts.\r\n\r\nTo this end, the directory provides an inventory of all known potential climate finance\r\n\r\nproviders. It aims to answer the following questions for each of the potential funding\r\n\r\nsources:\r\n\r\n• Would the organization fund low emissions agriculture projects (via grants, loans or other\r\n\r\ntype of financing)?\r\n\r\n• Are there specific grants and funding windows that would be most appropriate?\r\n\r\n• Are there countries or sectors of focus?\r\n\r\n• Are there any mandatory requirements for projects?\r\n\r\n• What are the funding amounts (minimum and maximum)?\r\n\r\n• What details are required for the proposal?\r\n\r\n• Is there a minimum financial return required for projects (e.g., a given Return on\r\n\r\nInvestment)?\r\n\r\n• What other financial indicators would normally be used to assess a project?\r\n\r\n• What kinds of entities do they usually fund? Private? Public? Only governments?\r\n\r\n• Are there specific indicators required to monitor adaptation or mitigation for grant projects\r\n\r\nfunded by this organization?\r\n\r\n• Who are the key contact points within the organization for any additional technical\r\n\r\nquestions?,CGIAR');
