INSERT INTO `deliverable_metadata_elements` VALUES ('6434', '1404', '8', 'Messages to the SBSTA 44 agriculture workshops. on “Identification of adaptation measures, taking into account the diversity of the agricultural systems, indigenous knowledge systems and the differences in scale as well as possible co-benefits and sharing experiences in research and development and on the ground activities, including socioeconomic, environmental and gender aspects”. \r\nIn this info note we provide a brief overview of key adaptation measures in agriculture. A twinned info note considers agricultural practices and technologies, which are one sub-set of adaptation measures.\r\nThis Info Note is related to this Working Paper: http://hdl.handle.net/10568/71049');
