INSERT INTO `deliverable_metadata_elements` VALUES ('6468', '1407', '8', 'WBCSD’s Low Carbon Technology Partnerships initiative (LCTPi) is a joint public and private initiative to accelerate low-carbon technology development. Climate Smart Agriculture is one of the solutions that the WBCSD and its member companies have identified as critical to reach the two degree Celsius target. The statement of ambition within this area is \"Make 50% more food available and strengthen the climate resilience of farming communities whilst reducing agricultural and land-use change emissions from commercial agriculture by at least 3.7 Gt CO2 eq/yr by 2030 (50%). By 2050 the target is to achieve a 65% emissions reduction.”');
