INSERT INTO `deliverable_metadata_elements` VALUES ('7182', '104', '8', 'The RHoMIS (Rural Household Multiple Indicator Survey) tool consists of a farm household survey that can be conducted on a digital platform using smart phones or tablets using the Open Data Kit (ODK) suite of software installed on Android based mobile phones or tablets (Hartung et al. 2010). Data can be directly uploaded to a web-server, and an associated set of analysis tools programmed in R extract the data and calculate indicators. The framework has been set up in such a way that additional modules of questions and indicators can be incorporated and analysed depending on the local study needs. In the supplementary material the paper version of the survey is included, while the ODK source code is available on request from the corresponding author. In the near future we will make the tools available through a website. Paper is unpublished as it will be submitted to a peer-reviewed journal.');
