INSERT INTO `deliverable_metadata_elements` VALUES ('7420', '573', '8', 'Based on the extensive review of existing frameworks and practices on climate change adaptation and\r\nauthors experiences in Indian context, this study presented BRIFFS (bottom-up, responsive, inclusive,\r\nflexible, forward-looking, and sustainable) as the major guidelines for developing LAPA. This study presented\r\nthe major steps of LAPA with clear actions, activities and also tools that can be used in each step. The nine\r\nsteps of LAPA are as follows: 1) Communicating climate change risks and adaptation measures at local level,\r\n2) Assessment of climate risks and vulnerabilities and scoping of adaptation actions, 3) Prioritisation\r\nof adaptation options, 4) Formulation of LAPA, 5) LAPA integration in planning process, 6) Institutional\r\narrangement to implement LAPA, 7) Implementation of LAPA, 8) Progress assessment of LAPA, and\r\n9) Feedback and revision of LAPA.');
