INSERT INTO `deliverable_metadata_elements` VALUES ('7759', '960', '7', null);
INSERT INTO `deliverable_metadata_elements` VALUES ('7760', '960', '8', 'An analysis of food crop germplasm flows into and out of Bhutan was carried out to determine the extent of reliance of Bhutanese agriculture on introduced germplasm. Methods used included literature review, key informant interviews, field visits and crop pedigree analysis. Bhutan has been introducing foreign germplasm since the 1960s. By December 2015, a total of about 300 varieties of 46 food crops including several non-traditional crops were introduced. Germplasm sources include CGIAR centres such as IRRI, CIMMYT and ICARDA, AVRDC, and countries such as Bangladesh, India, Japan, Korea, Nepal and Thailand. Pedigree analysis of rice varieties indicated that 74% of the released varieties originate in other countries. Bhutan has also contributed germplasm to several genebanks and countries. For example, IRRI has distributed about 3800 Bhutanese rice seed samples globally. Using imported germplasm, Bhutan has formally released over 180 varieties of cereals, fruit and vegetables. Prior to Convention on Biological Diversity, the outflow was largely unregulated, but the country is now developing formal exchange mechanisms with the creation of the National Biodiversity Centre in 1995. Bhutan’s reliance on external germplasm is rated high, a reality not well known by many Bhutanese people.');
