INSERT INTO `deliverable_metadata_elements` VALUES ('7788', '961', '2', 'Bal Krishna Joshi, Madan Raj Bhatta, Krishna Hari Ghimire and Deepa Singh');
INSERT INTO `deliverable_metadata_elements` VALUES ('7789', '961', '3', '');
