INSERT INTO `deliverable_metadata_elements` VALUES ('7793', '961', '7', null);
INSERT INTO `deliverable_metadata_elements` VALUES ('7794', '961', '8', 'To effectively implement the multilateral system (MLS) and facilitate exchange of genetic materials it is important to generate empirical evidence of the extent to which Nepal is dependent on foreign-sourced plant genetic resources for food and agriculture for its agricultural research and development (including breeding) and ultimately to food security. It is also important to examine how the flow of plant genetic resources takes place, how the resources are used for agricultural research and development, and what the pedigree of varieties important for food security looks like. It is also important to understand the gap in understanding of stakeholders on constraints and opportunities of exchange of plant genetic resources through MLS. This  chapter thus presents the patterns of germplasm flows and their contribution to crop breeding for developing modern varieties; analyzes pedigree of modern varieties of selected crops that are important for national food security; identifies the origins of ancestors of these modern varieties and documents key stakeholders’ perceptions on the pros and cons of exchange of plant genetic resources through MLS in order to give policy feedback to improve policymakers\' understanding of the subject.');
