INSERT INTO `deliverable_metadata_elements` VALUES ('8100', '1620', '8', 'PPB provides a means to improving food security in poor and agro-biodiverse countries, such as Honduras. Nevertheless, to incentivize farmers to engage in PPB research over the long term, seed regulatory systems must allow for the development of small seed enterprise. Research support must also be long term. PPB in Honduras has been successful because donor support to both scientists and NGOs for farmer participatory research has been sustained allowing for trusting partnerships to evolve between the different players.');
