INSERT INTO `deliverable_metadata_elements` VALUES ('8168', '771', '8', 'IFPRI researchers Mark Rosegrant, Keith Wiebe and Alex de Pinto led a session climate change impacts and solutions at global, regional and country scales at the Global Landscapes Forum on the margins of COP21 in Paris in December 2015. The session drew on new research to analyze policy options that promote healthy growth of the agricultural sector and food security in a changing climate. Participants Mercedita Sombilla (Director ANRES, National Economic and Development Authority, Office of the President, Philippines), Kirit N Shelat (Executive Chairman, Indian National Council for Climate Change Sustainable Development and Public Leadership), and Rodrigo Suarez Castaño (Climate Change Director, Ministry of Environment and Sustainable Development, Colombia) also shared insights and experiences from the national level.');
