INSERT INTO `deliverable_metadata_elements` VALUES ('9188', '1625', '8', 'Countries vary in their institutional technical and financial abilities to prepare for climate change in\r\nagriculture and to balance food security, adaptation, and mitigation goals.Indicators for climate readiness provide guidance to countries and enable monitoring progress. Readiness assessments can enable donors, investors and national decision-makers to identify where investments are needed or likely to be successful. Examples of climate readiness indicators are\r\nprovided for five work areas: 1. governance and stakeholder engagement, 2. knowledge and information services, 3. climate-smart agricultural strategy and implementation frameworks, 4. national and subnational capabilities and 5. national information and accounting systems.,Climate Focus,International Food Policy Research Institute');
