INSERT INTO `deliverable_metadata_elements` VALUES ('9426', '1630', '8', 'Coffee-Banana Intercropping (VBI) addresses all 3 pillars of CSA in a multifaceted way. CBI in both Arabica nad Robusta generates 50% more revenue then either coffee or banana monocrop. Farmers\' risk is reduced by practising CBI, making them more resilient to climate change impacts. Transformational changes are needed in the attitude towards CBI, to support scaling up of the practice.');
