INSERT INTO `deliverable_metadata_elements` VALUES ('9698', '1638', '8', 'This workshop was conducted as part of the mitigation strategies in rice production project,\r\nimplemented with support from the agriculture initiative of the Climate and Clean Air\r\nCoalition. The project is carried out in Bangladesh, Columbia, and Vietnam with the CGIAR\r\nResearch Program on Climate Change, Agriculture and Climate Change (CCAFS), the\r\nInternational Rice Research Institute (IRRI), and leading research and agriculture\r\norganizations in Vietnam.\r\n\r\nThe objectives of this workshop were to 1) share experiences with applying and scaling up the\r\nAWD technology for paddy rice in Bangladesh, 2) identify key areas, partners, and aspect of\r\nwork that need to be addressed, and 3) develop a detailed national plan for Phase I of the\r\nCCAC Rice Component.,Climate and Clean Air Coalition,Climate Change, Agriculture and Food Security,IRRI');
