INSERT INTO `deliverable_metadata_elements` VALUES ('9970', '1643', '8', 'The CCAFS Mitigation Options Tool (CCAFS-MOT) is being developed by the University of Aberdeen and the CGIAR Research Program on Climate Change, Agriculture and Food Security (CCAFS) to provide fast, accessible information on mitigation options for agriculture.  The tool suggests mitigation options that are well suited to the production system, soils and climatic conditions of the farm. The suggestions are based on empirical models and data from over a dozen different research studies.,CGIAR RESEARCH PROGRAM ON CLIMATE CHANGE, AGRICULTURE AND FOOD SECURITY');
