INSERT INTO `deliverable_metadata_elements` VALUES ('10038', '670', '8', 'Planning robust climate-smart development programs can be done today with existing information.\r\nWe propose a risk-household-option modeling approach to address household food security under climate change in Africa.\r\nThrough a case study in Niger, we demonstrate that prioritizing CSA is possible by taking into account livelihood status, risks, and potential effects of CSA practices.');
