INSERT INTO `deliverable_metadata_elements` VALUES ('13710', '965', '8', 'The research article analyzes the drivers of variations in food availability in 17 countries across contrasted agro-ecologies in sub-Saharan Africa. Using only three explanatory variables (household size, number of livestock, and land area), authors predict the agricultural determined status of food availability for 72% of the households. Analyzes suggest that targeting poverty through improving market access and off-farm opportunities is a better strategy to increase food security than focusing on agricultural production and closing yield gaps.');
