INSERT INTO `deliverable_metadata_elements` VALUES ('14832', '1107', '8', 'The poster evaluates the institutional and political context under which policies related to climate change are developed and implemented in Uganda and at examining their gender approaches at different governance levels (national, district, parish, community). The study finds that gender is minimized in policies because it is treated as cross-cutting, there is disconnect between what appears in documents and what actually happens and customary laws and traditions play a big role in the governance and dynamics of rural communities in Uganda.');
