INSERT INTO `deliverable_metadata_elements` VALUES ('15104', '1671', '8', 'Agriculture is unique among economic sectors in the nature of impacts from climate change. The production activity that transforms inputs into agricultural outputs involves direct use of weather inputs (temperature, solar radiation available to the plant, and precipitation). Previous studies of the impacts of climate change on agriculture have reported substantial differences in outcomes such as prices, production, and trade arising from differences in model inputs and model specification. This article presents climate change results and underlying determinants from a model comparison exercise with 10 of the leading global economic models that include significant representation of agriculture. By harmonizing key drivers that include climate change effects, differences in model outcomes were reduced. The particular choice of climate change drivers for this comparison activity results in large and negative productivity effects. All models respond with higher prices. Producer behavior differs by model with some emphasizing area response and others yield response. Demand response is least important. The differences reflect both differences in model specification and perspectives on the future. The results from this study highlight the need to more fully compare the deep model parameters, to generate a call for a combination of econometric and validation studies to narrow the degree of uncertainty and variability in these parameters and to move to Monte Carlo type simulations to better map the contours of economic uncertainty.');
