INSERT INTO `deliverable_metadata_elements` VALUES ('16157', '1678', '7', null);
INSERT INTO `deliverable_metadata_elements` VALUES ('16158', '1678', '8', 'Bioversity International is helping various countries design and implement a comprehensive capacity-building strategy to access and use plant genetic resources more effectively in the context of climate change adaptation. This resource box aims to support these efforts.\r\n\r\nBioversity International’s method for building more resilient seed systems includes the following eight steps:\r\n\r\n1. Situational analysis and planning\r\n2. Data preparation and selection of software\r\n3.  Climate change analysis and identification of germplasm\r\n4. Germplasm acquisition\r\n5. Field experimentation\r\n6. Germplasm conservation\r\n7.  Participatory evaluation\r\n8.  Knowledge sharing and communication \r\n\r\nThis resource box includes a specific module for each of these steps.\r\n\r\nModule 1, Situational analysis and planning, explains how to work with farmers and other stakeholders to determine baseline conditions in a community in terms of seed systems and climate change; how to set priorities and objectives; and  how to plan research into development intervention. \r\n\r\nModule 2, Data preparation and selection of software, introduces useful tools, such as DIVA-GIS, Maxent, and Climate Analogues, and explains how to prepare relevant data for a comprehensive climate change analysis.\r\n\r\nModule 3, Climate change analysis and identification of germplasm, describes the steps in climate change analysis in the context of impact on agriculture and seed systems and how to identify germplasm suitable for the future climate.\r\n\r\nModule 4, Germplasm acquisition, introduces the International Treaty on Plant Genetic Resources for Food and Agriculture, and explains how to acquire new germplasm while protecting traditional knowledge and taking into account the phytosanitary aspects of seed production and distribution.\r\n\r\nModule 5, Field experimentation, presents a number of methods for participatory crop evaluation with the newly acquired germplasm in local environments and farmers’ fields.\r\n\r\nModule 6, Germplasm conservation, discusses specific aspects of the conservation of the newly tested germplasm and the various ways in which it can be multiplied.\r\n\r\nModule 7, Participatory evaluation, presents a global method for evaluating the research process with farmers, genebank managers, extension agents, and other stakeholders.\r\n\r\nModule 8, Knowledge sharing and communication, is about sharing research results with the participants as well as with others involved or potentially interested in the results.');
