INSERT INTO `deliverable_metadata_elements` VALUES ('16260', '333', '8', 'The Working Paper No. XX show the inventory of the state of the art in climate information products in Colombia. It is expected that this document will become a guide to know the range of climate information available on the Internet, which is relevant in making agricultural decisions, identifying what their main users and what mechanisms are used information flow. The methodology that guides this document is based on the technical report by CATIE, 2015\r\n\r\nFrom 1 to 10 September, a workshop was held in CIAT on \"skill of climate prediction models\", Exchanging experiences with meteorological services and the other institutions that working in agro climate forecast with the main objective of creating a technical work table (discussion, evaluation, case studies and challenges) of possible routes to improve the use of climate prediction models in Colombia, Honduras, Guatemala and Peru,  through:\r\n-  Create a community of practice in climate forecasts in the Andean region (COL, PE) and Central America (GT, HN)\r\n-  Improve transparency and performance of climate forecasts in Colombia in the local technical agroclimatic committees\r\n-  Improve the use of the IRI’s Climate Predictability Tool (CPT), combining different variables and areas predictors.\r\n-  Support for the national and local technical agroclimatic committees \r\n\r\nThe workshop was conducted by the International Research Institute for Climate and Society (IRI), and the International Center for Tropical Agriculture (CIAT) with participating institutions (Acronym in Spanish): Colombian Corporation for Agricultural Research (CORPOICA), Institute of Hydrology, Meteorology and Environmental Studies (IDEAM), National Federation of Growers Cereals and Legumes (FENALCE), National Federation of Rice (FEDEARROZ), Refocosta, Center research Sugarcane in Colombia (CENICAÑA), National Weather Service Honduras (SMNH), National Institute of Seismology, Volcanology Meteorology and Hydrology in Guatemala (INSIVUMEH) and National Meteorology and Hydrology Service of Peru (SENAMHI).\r\n\r\nFrom 13 to 17 July in Tegucigalpa, a training workshop was held on: Using computational and statistical tools to support decision-making in agriculture, Was a joint agenda with the Ministry of Agriculture and Livestock (SAG), on the premises of the Permanent Commission of Contingencies (COPECO) for different SAG officials, COPECO, PNUD, INFOAGRO \r\n\r\nThe workshops and the results will be reflected in this deliverable. Also, through the support in the MSc thesis submitted to National University of Ireland, Galway in characterization of regional atmospheric circulation patterns and their relationship with observed temperature and precipitation in Colombia: An AGROCLIMAS Project by Thaize Baroni.\r\n\r\nDeliverables list:\r\n•  Working Paper: Inventory of agroclimatic information services in Colombia (Attached)\r\n        http://dapa.ciat.cgiar.org/estado-del-arte-de-los-productos-de-informacion-climatica-en-colombia-una-guia-para-conocer-la-oferta-de-informacion-agroclimatica-y-de-seguridad-alimentaria-en-colombia/\r\n•  Report: Resampling Method (attached)\r\n• Research project: MSc thesis characterization of regional atmospheric circulation patterns (Attached)\r\n•  Report: National/local technical agro-climatic committees and collaboration agreement with AGRONET (Attached)\r\n•  Workshops: \r\n        - http://dapa.ciat.cgiar.org/futbol-y-clima-taller-de-prediccion-climatica/ \r\n        - http://dapa.ciat.cgiar.org/agroclimas-llega-a-honduras-fortaleciendo-la-informacion-con-herramientas-y-metodologias/\r\n•   Speaker in 3 workshops (US,PA, SV) \r\n         - Climate Prediction Applications Science Workshop (CPASW): http://aces.nmsu.edu/cpasw/documents/3-giraldod-cpasw2015.pdf\r\n         - Foro Regional de Cambio Climático y Sanidad Agropecuaria - OIRSA:  Conference Proceedings  (Attached-draft)\r\n\r\nThe institutions know our work (through twitter, blogs, conferences, exchanges, newsletter). Brand positioning #agroclimas in twitter, e.g. the workshop on climate forecast, 982 people followed the news in twitter');
