INSERT INTO `deliverable_metadata_elements` VALUES ('16288', '94', '2', 'David Arango-Londoño, Mariella Carbajal, Adolfo Posadas, Diana Giraldo, Roberto Quiroz 2016. Evaluación de Fuentes y Metodologías para la Corrección de Productos Satelitales de Precipitación Diaria en Zonas Tropicales.');
