INSERT INTO `deliverable_metadata_elements` VALUES ('16293', '94', '7', null);
INSERT INTO `deliverable_metadata_elements` VALUES ('16294', '94', '8', 'In this research we propose using Generalized Additive Models (GAM) and Wavelet Transformation, integrated with satellite data (TRMM, AgMerra and CHIRSP) and observed field information for estimating daily precipitation data. This approach helpful to complete missing data in the stations whose records present a significant percentage of voids and also for interpolate precipitation. The results for Cordoba region in Colombia suggest that the proposed methodologies has good performance compared to the original data from TRMM, AgMerra or CHIRPS which have biases that need to be corrected.\r\n\r\nThe objectives was: a) Perform quality control of daily rainfall data that come from weather stations available by IDEAM in the department of Cordoba, b) evaluate the quality of different satellite products TRMM, AgMerra and CHIRPS based on information from the network of meteorological stations IDEAM in Cordoba, c) describe the methodologies proposed: Wavelet Transform and GAM models for the correction of satellite products daily rain and, d) Compare the performance of each source of information and correction by the method of cross-validation.\r\n\r\nDeliverable list: \r\n\r\n• Research report: Test of temperature data, AgMerra - IDEAM (obs. stations) Attached \r\n• Working paper: Evaluation of sources and methodologies for the correction of satellite precipitation products (Attached)\r\n• Workshops: Fewsnet (CHIRPS & Tools), RClimTool (Honduras & Colombia)\r\n• 4 BlogPost\r\n        - http://dapa.ciat.cgiar.org/rclimtool-mas-alla-de-datos-climaticos/\r\n        - http://dapa.ciat.cgiar.org/integracion-de-productos-satelitales-y-datos-de-estaciones-meteorologicas/\r\n        - http://dapa.ciat.cgiar.org/fews-net-seguridad-alimentaria-y-agroclimatologia/\r\n        - http://dapa.ciat.cgiar.org/rclimtool-asbama/');
