INSERT INTO `deliverable_metadata_elements` VALUES ('16328', '1195', '8', 'Improving productivity of sheep and goats (i.e. small ruminants- SR) under smallholder farming systems faced with challenges of unfavorable climatic events has been identified as one means of enhancing livelihoods of communities. The baseline study was implemented to understand the socio-economic aspects, population structure, management practices and production constraints of SR in the CSV of the Lower Nyando basin of Kenya.');
