INSERT INTO `deliverable_metadata_elements` VALUES ('16430', '866', '8', 'During this year we focused effort in the develop of a new version of climate analogues tool, with the overarching aim of explaining in an easy way the concept of analogues and the potential uses. Also we made changes to the appearance to reflect better integration with the design of the CCAFS web portal.  On the other hand, we developed a new R package of analogues that include specific functions to run the socio-economic approach, that we developed jointly with the CCAFS South Asia regional program. In terms of traffic, the statistics show stability in the number of users with 3,475 of visits in the tool from different countries including the United States, the United Kingdom, Colombia, Australia and Kenya.');
