INSERT INTO `deliverable_metadata_elements` VALUES ('16736', '340', '8', 'This report, is a methodology for the identification and characterization of agro-climatic growing areas bean, technicized and traditional maize in Colombia. The methodology is based on identifying contrasting soil and climatic environments from historical climate information and physico-chemical soil variables which have high influence on the growth of crops, and the interaction they have with the environment in which they develop. These results are part of the process of generating agro-climatic information from the past, for understanding the risk level of farmers to different scenarios of climate variability\r\n\r\nDeliverables list:\r\n•  Research Report: Characterization of Crop Environments to support the adaptation to climate variability  in Colombia');
