INSERT INTO `deliverable_metadata_elements` VALUES ('17926', '1683', '8', 'At a weather research station in Makueni, Kenya, about a dozen farmers are gathered in an\r\noutdoor classroom. Scant and variable rainfall is a big problem in Makueni, so a training program\r\nfrom the International Crops Research Institute for the Semi-Arid Tropics (ICRISAT) is tutoring the\r\ngroup on drought-resistant crops. But these few smallholders are not the only ones learning — the\r\ntips on climate adaptation are also being broadcast to millions of viewers across East Africa. A\r\nparticipant named Angela and her husband Joseph are the stars of this week’s episode of Shamba Shape-Up, a Kenyan reality television show that works with CCAFS and other partners to spread information on low-cost, climate-conscious solutions for small-scale farmers.');
