INSERT INTO `deliverable_metadata_elements` VALUES ('19286', '1698', '8', 'The Paris Agreement opens the door for more adaptation and mitigation in the agriculture sector. Countries must take urgent action to reduce emissions from the agriculture sector in order to limit global warming below 2 degrees C. Funding and political will are needed to support developing countries to implement their plans to combat and adapt to climate change in the\r\nagriculture sector. The global agriculture community, including CGIAR, must step up and engage in key UNFCCC processes between now and 2020 to drive action and innovation on issues related to agriculture,Internal Review');
