INSERT INTO `deliverable_metadata_elements` VALUES ('21802', '1709', '8', 'Tracking change is how you stay on the path to a goal. That’s why the CGIAR Research\r\nProgram on Climate Change, Agriculture and Food Security (CCAFS) wants to measure\r\nhow agricultural practices are evolving in response to climate change and other pressures.\r\nIn 2010-2011 CCAFS worked with local partners to organize a series of surveys and\r\nconsultations at 15 sites in East Africa, West Africa and South Asia — every region where\r\nCCAFS was working at the time. In 2014, new CCAFS sites in Southeast Asia and Latin\r\nAmerica were included.');
