INSERT INTO `deliverable_metadata_elements` VALUES ('22006', '1715', '8', 'In  2010-2012, the  CGIAR   Research  Program on  Climate   Change,   Agriculture   and   Food  Security \r\n(CCAFS) implemented  a   baseline  in  15  sites   across  three   initial   target  regions: East   Africa,  West  \r\nAfrica and  Indo-Gangetic Plains. The baseline  was setup in  such  a way that  the households  selected  \r\ncould be  a revisited after five  and ten years.  The aim is  to  track behavioral  change  over  time in each  \r\nof  the sites by  collecting agricultural and household data. Through analyzing the collected data, the \r\naim is  to  promote a food-secure world through the provision of  science-based efforts that  support \r\nsustainable agriculture and enhance livelihoods while adapting   to  climate   change and  conserving \r\nnatural resources and environmental services.');
