INSERT INTO `deliverable_metadata_elements` VALUES ('22414', '1722', '8', 'El siguiente informe abordará los resultados del primer y segundo taller de Priorización de Inversiones en Agricultura Sostenible Adaptada al Clima realizados los días 7 de Agosto de 2014 y 18 de Junio de 2015 respectivamente, en Ciudad de Guatemala, Guatemala. A través de las secciones se presentarán cada una de las actividades desarrolladas durante los eventos, y al mismo tiempo se hará un breve análisis de los principales resultados obtenidos junto con unas conclusiones finales.\r\n\r\nLa información aquí presentada, será el insumo necesario para completar el ciclo de priorización de prácticas ASAC dentro del Marco de Priorización e iniciar una etapa de construcción del entorno favorable para la adopción y escalamiento de portafolios de prácticas de Agricultura Sostenible Adaptada al Clima (ASAC) con la colaboración articulada entre el MAGA y los diferentes actores involucrados e identificados durante el proceso.,Internal Review');
