INSERT INTO `deliverable_metadata_elements` VALUES ('22442', '1723', '2', 'Rosenstock TS,Lamanna C,Chesterman S,Bell P,Arslan A,Richards M,Rioux J,Akinleye AO,Champalle C,Cheng Z,Corner-Dolloff C,Dohn J,English W,Eyrich AS,Girvetz EH,Kerr A,Lizarazo M,Madalinska A,McFatridge S,Morris KS,Namoi N,Poultouchidou N,Ravina da Silva M,Rayess S,Ström H,Tully KL,Zhou W');
