INSERT INTO `deliverable_metadata_elements` VALUES ('22822', '1231', '8', '-  A total of 12 blogs and 6 videos were written on scenario processes to guide policymaking in Central America and the Andes. These news items were reproduced in at least 19 other media platforms, including UCI´s website and mayor agriculture news sites such as Proagro and IAgua. Unless mentioned otherwise, all blogs were published in English and Spanish.\r\n-   Of these 11 blogs, 2 blogs were written to accompany a policy brief, 1 blog to accompany a paper, 1 opinion article to share learnings of scenario guided policy work at local, regional and national levels and the rest to inform about scenario exercises on national and regional level:\r\n\r\n     1.  ¨Escenarios Futuros: una herramienta clave para el desarrollo de la INDC de Costa Rica¨ by Marieke Veeger (2015). CCAFS. https://ccafs.cgiar.org/es/news/escenarios-futuros-una-herramienta-clave-para-el-desarrollo-de-la-indc-de-costa-rica#.Vs4dHPkrIgt\r\n     2. Blog of workshop to create the scenarios for Central America: En qué debe trabajar Centroamerica hacia 2050? (Revista Mercados y Tendencias) \r\n    3. Blog of workshop to create the scenarios for Central America, published by UCI: ¨Taller CCAFS- UCI: “Escenarios Futuros para la Seguridad Alimentaria y Ambiente en Centroamérica”\r\n    4.  Blog on workshop to create future scenarios for the Andes region. Hananta Yuyaspa - a new day and start - for the Andean countries , by Manon Koningstein (CIAT)\r\n    5.  An opinion article was written by Cecilia Schubert, Marieke Veeger and Jose Luis Urea and published by CCAFS: ¨ Central America can fight back against climate change by envisioning its future today¨ Proagro and IAgua also published the article. \r\n    6. Blog about paper on quantification of the regional scenarios in three regions, including Latin America: ¨Back to the future: using scenarios to road-test the policies of tomorrow¨ by Amanda Palazzo (IIASA)\r\n    7. Blog scenario workshop to analyze policies of Andes countries, supported by UNEP-WCMC:  “Andean countries join forces to strengthen policies in the face of future scenarios”  by Joost Vervoort and Elisabeth van de Grift\r\n    8. Blog on scenario workshop in Honduras to test and improve national climate change strategy for agriculture and livestock:  “Helping Honduras build a more robust climate adaptation strategy for the agriculture sector” by Cecilia Schubert\r\n    9.  Blog to announce scenario exersize with ACICAFOC and SAG in Honduras: ¨Taller: cambio climático y escenarios socioeconómicos para guiar planes de adaptación de pequeños productores¨ by Jose Luis Urrea (only in spanish)\r\n  10. Blog about scenario exercise with cacao producers from Central America (ACICAFOC) and SAG in Honduras: ¨Cocoa farmers in Central America learn to plan for a more variable climate¨ by Jose Luis Urea \r\n  11. Blog about Costa Rica´s scenario guided Intended National Determined Contribution (INDC): ¨Escenarios futuros para guiar la contribución prevista determinada de Costa Rica¨\r\n  12. WRI published a blog about a scenario workshop in the Trifinio facilitated by CCAFS and UCI: “Intelligent ideas: scenarios to manage water as climate changes in Guatemala” by Moushumi Chaudhury. The blog was republished by CCAFS. \r\n  13. UCI also gave 2 webinars on the scenarios program and methodology for PMI´s Global Sustainability Community Practice and 2 webinars for UCI´s Global School of Project Management: 731 participants in total \r\n  14.  UCI gave a presentation to 34 decision makers of ministries of agriculture and planning of 7 countries in Latin America of scenario program in CCAFS LAM COP20 side event ¨Tools and Methods for Planning and Decision making in Climate Change and Agriculture.  \r\n\r\nThe slideshow has been viewed on Slideshare 608 times.\r\n- 6 videos were made to illustrate scenario development and cases of scenario guided policymaking\r\n     o Video on development of Central America scenarios https://www.youtube.com/watch?v=cXPGlc1lrww\r\n     o Video on development of Andes scenarios https://www.youtube.com/watch?v=JyzKY2dbR4I\r\n     o Video on scenario use to guide 4 agriculture policies in the Andes https://www.youtube.com/watch?v=EQkIWRa9zkM&index=5&list=PLmATng7lKk6Uv5oVJfgDsGWylO6CDCmSV\r\n    o Video on scenario use to guide regional adaptation plans in Honduras https://www.youtube.com/watch?v=ME3HxZzLoiw \r\n    o  Video on scenario use to guide Costa Rica´s INDC https://vimeo.com/147130700\r\n    o Video to illustrate scenario use to develop the Honduran ¨Strategy for risk management and climate change adaptation (2015-2019) for the sector of agriculture and livestock”, with statements from key stakeholders from the Ministry of Agriculture (SAG) that confirm the impact the scenario guided recommendations had on the final version of the strategy. https://www.youtube.com/watch?v=rejGKbTFfWs&feature=youtu.be');
