INSERT INTO `deliverable_metadata_elements` VALUES ('24012', '402', '8', 'The data represent first results from a study on greenhouse gas (GHG) emissions from dairy cattle in Kenya, assessing co-benefits between milk production and mitigation. Available are baseline estimates focussing on enteric fermentation, manure and soil management (CH4, N2O) under current feeding and manure management regimes. The data are derived from a dynamic model simulating dairy cows in time, including milk and excreta production as well as resulting GHG emissions on a monthly basis. Available outputs are expressed as per cow head (spreadsheets) and spatially up scaled on livestock production systems using cattle type and herd composition data (Geotiff grids) at a spatial resolution of 1km. Please note that the results are preliminary.');
