INSERT INTO `deliverable_metadata_elements` VALUES ('24964', '1767', '8', 'Agriculture is well represented in Parties’ adaptation and mitigation strategies as communicated in their Intended Nationally Determined Contributions (INDCs) to the United Nations Framework Convention on Climate Change (UNFCCC). There is much attention to conventional agricultural practices that can be climate-smart (e.g. livestock and crop management), but less to the enabling services that can facilitate uptake (e.g. climate information services, insurance, and credit). Considerable finance is needed for agricultural adaptation and mitigation by Least Developed Countries (LDCs) – in the order of USD 3 billion annually for adaptation and 2 billion annually for mitigation. Parties need better information in order to refine their finance needs. Non-Annex 1 Parties raise issues of climate justice, social inequality and food security in their INDCs.,Internal Review');
