INSERT INTO `deliverable_metadata_elements` VALUES ('25032', '1768', '8', 'Analysis of agriculture in countries’ climate change mitigation and adaptation strategies finds: Most Parties to the UNFCCC include agriculture in their mitigation targets (80%) and adaptation strategies (64%); Non-annex 1 Parties note the need for international financial support to implement their INDCs and raise the ambition of their contributions; For countries to meet their targets, climate finance will need to address agriculture.,Internal Review');
