INSERT INTO `deliverable_metadata_elements` VALUES ('25576', '1780', '8', 'Although community level seed-saving initiatives have been around for about 30 years, until recently they have received little attention in the scientific literature on climate change adaptation and plant genetic resources. Based on a literature review and a series of case studies it is argued that community seedbanks can enhance the resilience of farmers, in particular of communities and households most affected by climate change, through securing improved access to and availability of diverse, locally adapted crops and varieties and through enhancement of related indigenous knowledge and skills in planting management including seed selection, treatment, storage, multiplication and dissemination.');
