INSERT INTO `deliverable_metadata_elements` VALUES ('27207', '678', '7', null);
INSERT INTO `deliverable_metadata_elements` VALUES ('27208', '678', '8', 'The first phase of the activity 1 “Capturing the diversity of maize-bean-cassava-livestock small holder systems and developing farm household typologies for targeting CSAP’s portfolios” consisted in focus group discussions with farmers from the CCAFS sites led by CIMMYT in three sites: Wote (Kenya), Lushoto (Tanzania) and Rakai (Uganda). The preliminary outputs were a selection of variables created and selected by farmers in gender differentiated groups. Farmers were asked to identify the four most important variables that can be used to classify their community of farmers. For each variable, farm /household types were given, with characteristics for each as well as information on the cropping/livestock system and /or the management of these farms. Finally, farmers indicated the proportion of each type in their community.  Four groups (two women and two men groups) participated in this activity in each site, for a total of 16 FGD.  The results were then analyzed to produce a typology of farmer household for each site. Per site, variables across the four groups were compared to find similarities or differences. In all three site three types of farms were described. These results are described below.\r\n\r\nThese results will lead the sampling strategy for activity 3. We will sample 3 villages per CCAFS site. In each village one farm of each group be sampled thus 3 farms per village, a total of 9 farms per CCAFS site. We will conduct HH surveys with the selected farmers. Data collected will be used for modelling case study farms with the model FarmDESIGN. The baselines will be modelled first. Scenarios will be modelled later on including CSA portofolio according to the results of Module 3 CSA selection and prioritization from these past FGD.');
