INSERT INTO `deliverable_metadata_elements` VALUES ('27956', '956', '8', 'In the case study country, GLOBIOM-Ethiopia has been successfully developed to represent main drivers of agricultural change at the third administrative level (woreda). GLOBIOM-Ethiopia integrates a new typology of farming systems which combines agro-ecological zones, set of activities, and land intensification gradient. Household survey data have been used to better represent Ethiopian smallholders’ diversity in the model. Scenarios are being developed to investigate the impact of policies to improve market access and irrigation coverage on smallholders’ food security and poverty status.');
