INSERT INTO `deliverable_metadata_elements` VALUES ('28466', '1815', '8', 'Advance knowledge of climate information is important in helping farmers make decisions on resource allocation and type of agricultural enterprises in a season. Climate information coupled with agro-advisory services offers greater potential to enhance capacity of farmers to adapt to climate variability and climate change. In East Africa (EA), significant gaps still exist in provision of climate services for farmers, specifically downscaled location-specific forecasts, reliable, timely, and user-friendly climate information that effectively addresses farmer’s needs. Consequently, farmers often rely on indigenous knowledge (IK) for their seasonal forecasts, where locally observed variables and experiences are used to assess and predict the local weather conditions and climate e.g. onset of rains. However, IK is not widely documented and often passed on from one generation to another through oral history, thus creating a wide inter-generational gap between IK custodians and the young generation.');
