INSERT INTO `deliverable_metadata_elements` VALUES ('28500', '1816', '8', 'The negative impacts of climate change on agricultural productivity and food security varies by gender and wealth affecting the vulnerable groups, especially women. Various factors exacerbate the differential effects of climate change on gender, among them persisting sociocultural behaviours, economic roles and responsibilities and political barriers. Other barriers include limited access to resources, new technologies, information and credit. In East Africa, women’s reliance on ecological resources, coupled with the above further exacerbate the problem. This study conducted in Nyando, Kenya aims to understand the climate risks and adaptation strategies in agriculture for men and women across different household types. We used survey data from 200 households, complimented with information from four focus group discussions. Out of the respondents, 45.5% and 54.5% were male and female headed households respectively.');
