INSERT INTO `deliverable_metadata_elements` VALUES ('28534', '1817', '8', 'Small companies and informal trade plays an important role in East African agriculture but are typically out of view. This study examines patterns of and incentives for private sector investments and activities in climate-smart agriculture (CSA) in East Africa. Building capacity of private sector entities and improving their coordination with the public sector so that smallholders are not excluded may be key to facilitating the scaling up of agricultural innovations that improve food security for smallholders grappling with a changing climate (Jayne et al.2006; Gyau, 2015).');
