INSERT INTO `deliverable_metadata_elements` VALUES ('28568', '1819', '8', 'Rural households in East Africa depend on rain fed agriculture as the primary source of food and income. In Nyando, Variation in seasonal rainfall coupled by late onset and early cessation events contributes to water stress and reduces length of crop growing period. Drought and flooding events are worsening land degradation. With these risks, nearly 15 percent of households in Nyando are unable to meet their food needs for 3-4 months in a year, and malnutrition in children under five years is estimated to be 40 percent. Nyando climate -smart villages Climate-smart villages (CSVs) are sites where researchers and development partners are working with smallholder farmers to test climate-smart agricultural interventions. Climate-smart agriculture aims to sustainably increase productivity and income, build resilience to climate change, reduce green house gas emissions where possible and enhance achievement of national food security and development goals. CSVs are learning grounds for researchers, policy makers, development practitioners and farmers.');
