INSERT INTO `deliverable_metadata_elements` VALUES ('29350', '1824', '8', 'Policies, institutions and services to help farmers develop new approaches to deal with climate change will need to produce results for women farmers as well as men. This brief provides five policy lessons to support this process, based\r\non evidence from research in low- and middle- income countries and offers guidelines for crafting gender-responsive climate policies at global and national levels. This research was presented in March 2015 at a seminar in Paris on ‘Closing the gender gap in farming under climate change’, co-organized by the CGIAR Research Program on Climate Change, Agriculture and Food Security (CCAFS), the International Social Science Council (ISSC) and Future Earth.,Internal Review');
