INSERT INTO `deliverable_metadata_elements` VALUES ('29690', '1023', '8', 'QuadUI is the application originally developed under AgMIP to translate agricultural model inputs and parameters from one model to another. One specific deliverable under activity 350.2 on CRAFT is the production of a full translational capability between DSSAT, APSIM and SarraH model allowing interfacing of CRAFT and SarraH. This was deemed a high priority activity as SarraH is the preferred crop model used at Agrhymet Regional Centre. The translator has been completed following work between CASCAID scientists M. Adam (ICRISAT/CIRAD), Gerrit Hoogenboom (WSU/UF), Meng Zhang (UF), Cheryl Porter (UF), Henri Songoti (Agrhymet), Agali Alhassane (Agrhymet), Pierre C. Sibiry Traore (ICRISAT/IER).');
