INSERT INTO `deliverable_metadata_elements` VALUES ('30608', '1838', '8', 'Una de las principales consideraciones para la creación del Tratado Internacional\r\nsobre los Recursos Fitogenéticos para la Alimentación y la Agricultura y de su\r\nSistema Multilateral para el acceso y la distribución de beneficios es el\r\nreconocimiento de la interdependencia de todos los países sobre los recursos\r\ngenéticos de los cultivos y forrajes más importantes para la seguridad alimentaria\r\nglobal. Para apoyar la implementación de un sistema global de acceso e intercambio\r\nde recursos fitogenéticos, contribuyendo al desarrollo agrícola y la adaptación al\r\ncambio climático de los países, es necesario apreciar los beneficios de los\r\nintercambios históricos de germoplasma y reconocer que es urgente que un sistema de\r\nintercambio facilitado siga en pie y se expanda en el futuro. Tomando el caso de\r\nGuatemala, y del maíz y frijoles como cultivos principales, el artículo describe la\r\ndinámica de los recursos genéticos de estos dos cultivos, tanto dentro como fuera del\r\npaís, en el pasado y mirando hacia el futuro. Se ilustra así el grado en que Guatemala\r\ndepende de germoplasma de otros países para su seguridad alimentaria, y cómo, de\r\nmanera complementaria, otros países dependen de germoplasma procedente de\r\nGuatemala. Se espera que la información presentada aquí estimule y facilite la\r\nimplementación del Tratado Internacional y del Sistema Multilateral en el país.');
