INSERT INTO `deliverable_metadata_elements` VALUES ('30642', '1839', '8', 'L\'interdépendance des pays sur les ressources génétiques des cultures et fourrages\r\ndont ils ont bessoin pour leur sécurité alimentaire est une des raisons de la mise en\r\nplace du Traité International sur les Ressources Phytogénétiques pour l\'Alimentation\r\net l\'Agriculture et de son système multilatéral d\'accès et de partage des avantages. Une\r\nconnaissance plus profonde de la façon dont les pays ont bénéficié de l\'échange de\r\nmatériel génétique dans le passé et continueront à bénéficier à l\'avenir est nécessaire\r\npour faire avancer la mise en oeuvre du Système multilatéral et la création d\'une\r\nréserve mondiale des ressources phytogénétiques pour le développement agricole des\r\npays et leur adaptation au changement climatique. En utilisant Burkina Faso comme\r\nun exemple et le millet, le riz et le maïs comme cultures principales, cet étude\r\nprésente les mouvements de matériel génétique tant à l\'intérieur et à l\'extérieur du\r\npays, au cours des dernières années et dans l\'avenir. Il illustre le degré de dépendance\r\ndu Burkina Faso du matériel génétique provenant d\'autres pays pour sa sécurité\r\nalimentaire et aussi l’utilisation par des autres pays du matériel génétique burkinabé.\r\nL\'information qu’on présente peut encourager et faciliter la mise en oeuvre du Traité\r\ninternational et de son Système multilatéral dans le pays.');
